import{_ as a,c as r,o as t,ad as o}from"./chunks/framework.DtW8lrcE.js";const c=JSON.parse('{"title":"支持一下","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"guide/overview/support-the-project.md","filePath":"guide/overview/support-the-project.md","lastUpdated":1739876406000}'),l={name:"guide/overview/support-the-project.md"};function i(h,e,n,s,p,u){return t(),r("div",null,e[0]||(e[0]=[o('<h1 id="支持一下" tabindex="-1">支持一下 <a class="header-anchor" href="#支持一下" aria-label="Permalink to &quot;支持一下&quot;">​</a></h1><p>🥳让我们共同成长~</p><p>欢迎来到AMMDS的支持页面！感谢您对我们的关注和支持。您的每一份支持都将直接帮助我们改进和扩展AMMDS的功能和服务，为您和其他用户提供更好的体验。</p><h2 id="如何支持我们" tabindex="-1">如何支持我们？ <a class="header-anchor" href="#如何支持我们" aria-label="Permalink to &quot;如何支持我们？&quot;">​</a></h2><h3 id="_1-成为我们的一员" tabindex="-1">1. 成为我们的一员 <a class="header-anchor" href="#_1-成为我们的一员" aria-label="Permalink to &quot;1. 成为我们的一员&quot;">​</a></h3><p>通过访问我们的<a href="https://store.lifebus.top/" target="_blank" rel="noreferrer">在线商店</a>，您可以购买与AMMDS相关的商品或服务。这不仅能够让您获得高质量的产品，同时也是对我们工作的极大支持。</p><h3 id="_2-分享给朋友" tabindex="-1">2. 分享给朋友 <a class="header-anchor" href="#_2-分享给朋友" aria-label="Permalink to &quot;2. 分享给朋友&quot;">​</a></h3><p>如果您喜欢使用AMMDS，请不要犹豫，将它推荐给您的家人和朋友吧！分享不仅是对我们的鼓励，还能帮助更多的人发现和使用这款应用。</p><h3 id="_3-数据贡献" tabindex="-1">3. 数据贡献 <a class="header-anchor" href="#_3-数据贡献" aria-label="Permalink to &quot;3. 数据贡献&quot;">​</a></h3><p>AMMDS项目中的数据支持共享模式，这意味着任何人都可以查看、修改并提出改进建议。如果您有其他问题，欢迎您在<a href="https://github.com/QYG2297248353/AMMDS-Docker" target="_blank" rel="noreferrer">GitHub</a>上报告您遇到的问题。</p><h3 id="_4-提供反馈" tabindex="-1">4. 提供反馈 <a class="header-anchor" href="#_4-提供反馈" aria-label="Permalink to &quot;4. 提供反馈&quot;">​</a></h3><p>您的意见对我们至关重要。无论是功能请求、错误报告还是其他任何想法，都请随时告诉我们。您可以通过我们的<a href="https://blog.lifebus.top" target="_blank" rel="noreferrer">官网</a>联系我们，或者直接在GitHub上提交问题。</p><h2 id="关于ammds" tabindex="-1">关于AMMDS <a class="header-anchor" href="#关于ammds" aria-label="Permalink to &quot;关于AMMDS&quot;">​</a></h2><p>AMMDS是一款专为影视爱好者设计的数据管理平台，它可以帮助您轻松管理和享受您的个人影视库。从自动刮削元数据到智能匹配本地文件，再到跨平台支持，AMMDS旨在为您提供最佳的用户体验。</p><ul><li><strong>了解更多</strong>：<a href="/guide/quick-start">快速开始指南</a></li><li><strong>探索官方博客</strong>：<a href="https://blog.lifebus.top" target="_blank" rel="noreferrer">人生足迹·博客</a></li></ul><h2 id="联系我们" tabindex="-1">联系我们 <a class="header-anchor" href="#联系我们" aria-label="Permalink to &quot;联系我们&quot;">​</a></h2><p>有任何疑问或需要帮助？请不要犹豫，通过以下方式联系我们：</p><ul><li>邮箱：support@lifebus.top</li><li>在线商店：<a href="https://store.lifebus.top/" target="_blank" rel="noreferrer">立即访问</a></li><li>GitHub：<a href="https://github.com/QYG2297248353/AMMDS-Docker" target="_blank" rel="noreferrer">参与贡献</a></li></ul><br><footer style="font-size:0.8em;"> 新疆萌森软件开发工作室提供技术支持 <br> 版权所有 © 2023-2025 <a href="https://beian.miit.gov.cn" rel="noreferrer" target="_blank">新ICP备2023003452号-1</a></footer>',20)]))}const f=a(l,[["render",i]]);export{c as __pageData,f as default};
